import React, { useContext } from "react";
import "../index.css";
import { targetListContext } from "./AnimeMap"; // Import the context

import "../styles/TargetList.css";

function TargetList() {
  // Use the useContext hook to access the context values
  const { listXPosition, listYPosition } = useContext(targetListContext);

  return (
    <div
      className="targetList"
      style={{
        top: `${listYPosition}px`,
        left: `${listXPosition}px`,
      }}
    ></div>
  );
}

export default TargetList;
